// Create a function that takes integers, floats, or strings representing
// real numbers, and returns the larger variable in its given variable type.
// Return nil if the values are equal.
// Note: If a real number is represented as a string, the floating point might be . or ,
//
// CompareOne(1, 2.5) ➞ 2.5
// CompareOne(1, "2,3") ➞ "2,3"
// CompareOne("5,1", "6") ➞ "6"
// CompareOne("1", 1) ➞ nil
func CompareOne(a, b interface{}) interface{} {
	// Convert both values to float64 for comparison
	aVal := toFloat64(a)
	bVal := toFloat64(b)

	// If they are equal, return nil
	if aVal == bVal {
		return nil
	}

	// Return the larger value in its original type
	if aVal > bVal {
		return a
	}
	return b
}

// Helper function to convert interface{} to float64
func toFloat64(val interface{}) float64 {
	switch v := val.(type) {
	case int:
		return float64(v)
	case float64:
		return v
	case string:
		// Replace comma with period for parsing
		normalized := strings.ReplaceAll(v, ",", ".")
		f, err := strconv.ParseFloat(normalized, 64)
		if err != nil {
			return 0
		}
		return f
	default:
		return 0
	}
}

